CREATE DEFINER = 'root'@'localhost' TRIGGER `adjustment_info_after_upd_tr` AFTER UPDATE ON `adjustment_info`
  FOR EACH ROW
BEGIN
	IF NEW.is_active=FALSE OR NEW.is_deleted=TRUE THEN
